import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import GoogleLogin from 'react-google-login';

// import { Button, Form, Col, FormGroup, Checkbox } from 'react-bootstrap'
import Form from 'react-bootstrap/Form'
import { Button} from 'react-bootstrap';

import socket from '../../../components/SocketUser';
import { Column, Row } from 'simple-flexbox';


class LoginAsStudent extends Component {

  constructor(props){
    super(props);

  }

  render() {
    if(this.props.step == "LoginAsStudent"){
        return (
          <div className='center-me'>

            <Column horizontal='center' flexGrow={1}>


              <Row horizontal='center'>
                  <h1>student!</h1>
              </Row>

              <Row horizontal='center'>
                <Form onSubmit = {this.sendWorkspace}>
                  <Form.Group controlId="formBasicWorkspaceName">
                    <Form.Label>Workspace name</Form.Label>
                    <Form.Control required type="text" placeholder="Enter workspace name" />
                  </Form.Group>

                  <Row horizontal='center'>
                    <Button variant="primary" type="submit">Enter your workspace!</Button>
                  </Row>
                </Form>
              </Row>

            </Column>
          </div>
        )

    } else{
      return null;
    }
  }

}


export default LoginAsStudent;
